NO CONTEST plea entered to count 1, PTC burglary.  Convicted.
The State moves to dismiss and read in count 2.  Motion granted.
Sentence Withheld.  Defendant is placed on probation to DOC for three (3) years.
Conditions of probation:
1) Assessment, treatment, counseling as deemed appropriate by the Departments assessment process;
2) AODA assessment and follow through;
3) Undergo mental health assessment and follow through;
4) Submit to random urine screens and pay for same;
5) No contact with Alex Novak;
6) Defendant is to develop a plan for positive social activity outside the home, with her agent;
7) Provide DNA sample;
8) Spend sixty (60) days in the county jail, under the Huber Law, stayed and to be imposed at the agents discretion and upon order of the court;
9) Pay court costs;
10) pay supervision fees in an amount to be determined by DOC;
11) have no contact with the victims, Richard Bowe, Heidi Schultz, Suzanne Sieracki or their residences.
There is cash bail in the amount of $2,750.00.  The Court orders that it be used to pay the defendant's portion of the restitution which is $2,538.48.  The co-defendant has already paid the full amount to the victims.  The Clerk is instructed to contact Attorney Mike Lambert, the co-defendant's attorney, to find out who the payment should be made to.  Any balance of cash bail is ordered applied to court costs.
Minutes.
